import React, { useState, useEffect } from 'react';
import { BarChart, TrendingUp, Users, Eye, MousePointer, Clock, PartyPopper, X } from 'lucide-react';
import { Card } from '../../components/Card';
import { Badge } from '../../components/Badge';
import { Button } from '../../components/Button';
import { Checkbox } from '../../components/Checkbox';
import { InfoBox } from '../../components/InfoBox';

interface Step4Props {
  onComplete: () => void;
  appData: {
    appId: string;
    dataUrl: string;
    selectedVersion: 'saas' | 'private' | null;
  };
}

export const Step4AnalyticsStart: React.FC<Step4Props> = ({
  onComplete,
  appData
}) => {
  const [understood, setUnderstood] = useState(false);
  const [celebrationShown, setCelebrationShown] = useState(false);
  const [hasCompleted, setHasCompleted] = useState(false);

  useEffect(() => {
    if (understood && !hasCompleted) {
      onComplete();
      setCelebrationShown(true);
      setHasCompleted(true);
    }
  }, [understood, hasCompleted, onComplete]);

  const dashboardSteps = [
    {
      step: 1,
      title: '대시보드 템플릿 선택',
      description: '사전 구성된 템플릿 중 하나를 선택하거나 빈 대시보드로 시작하세요.',
      icon: <BarChart size={20} color="#334155" />
    },
    {
      step: 2,
      title: '기본 차트 추가',
      description: '사용자 수, 페이지 뷰, 이벤트 추적 등 기본 차트를 추가하세요.',
      icon: <TrendingUp size={20} color="var(--success)" />
    },
    {
      step: 3,
      title: '필터 및 기간 설정',
      description: '분석하고 싶은 기간과 조건을 설정하세요.',
      icon: <Clock size={20} color="var(--warning)" />
    },
    {
      step: 4,
      title: '대시보드 공유',
      description: '완성된 대시보드를 팀원들과 공유하세요.',
      icon: <Users size={20} color="var(--info)" />
    }
  ];

  const recommendedMetrics = [
    {
      category: '사용자 분석',
      icon: <Users size={24} color="#334155" />,
      metrics: [
        { name: 'DAU (일일 활성 사용자)', description: '하루 동안 앱을 사용한 고유 사용자 수' },
        { name: 'MAU (월간 활성 사용자)', description: '한 달 동안 앱을 사용한 고유 사용자 수' },
        { name: '신규 사용자', description: '처음으로 앱을 사용하는 사용자 수' },
        { name: '재방문 사용자', description: '이전에 앱을 사용한 적이 있는 사용자 수' }
      ]
    },
    {
      category: '참여도 분석',
      icon: <MousePointer size={24} color="var(--success)" />,
      metrics: [
        { name: '페이지 뷰', description: '각 페이지가 조회된 총 횟수' },
        { name: '세션 수', description: '사용자가 앱을 사용한 세션의 총 개수' },
        { name: '평균 세션 시간', description: '사용자가 한 번의 세션에서 머무는 평균 시간' },
        { name: '바운스율', description: '한 페이지만 보고 떠나는 사용자의 비율' }
      ]
    },
    {
      category: '행동 분석',
      icon: <Eye size={24} color="var(--warning)" />,
      metrics: [
        { name: '클릭률', description: '특정 요소가 클릭되는 비율' },
        { name: '전환율', description: '목표 행동을 완료하는 사용자의 비율' },
        { name: '퍼널 분석', description: '사용자가 특정 과정을 완료하는 단계별 분석' },
        { name: '히트맵', description: '사용자가 가장 많이 상호작용하는 영역 시각화' }
      ]
    }
  ];

  return (
    <div>
      {/* Step Title */}
      <div style={{ marginBottom: '32px' }}>
        <div style={{ 
          display: 'flex', 
          alignItems: 'center', 
          gap: '12px',
          marginBottom: '16px' 
        }}>
          <BarChart size={24} color="#334155" />
          <h3 style={{ 
            fontSize: '24px', 
            fontWeight: '600', 
            color: 'var(--gray-900)',
            margin: 0
          }}>
            4단계: 분석 시작
          </h3>
        </div>
        <p style={{ 
          fontSize: '16px', 
          color: 'var(--gray-600)',
          lineHeight: '1.6',
          margin: 0
        }}>
          이제 첫 번째 대시보드를 생성하고 데이터 분석을 시작해보세요. 
          추천 지표를 참고하여 의미있는 인사이트를 얻을 수 있습니다.
        </p>
      </div>

      {/* Configuration Summary */}
      <div style={{ marginBottom: '32px' }}>
        <Card>
          <h4 style={{ 
            fontSize: '18px', 
            fontWeight: '600', 
            marginBottom: '16px',
            color: 'var(--gray-900)'
          }}>
            설정 완료된 구성
          </h4>

          <div style={{ 
            display: 'grid', 
            gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', 
            gap: '16px',
            marginBottom: '16px'
          }}>
            <div style={{ 
              padding: '12px', 
              background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)', 
              borderRadius: 'var(--border-radius)',
              border: '1px solid var(--gray-200)'
            }}>
              <div style={{ fontSize: '12px', color: 'var(--gray-500)', marginBottom: '4px' }}>버전</div>
              <div style={{ fontSize: '14px', fontWeight: '600', color: 'var(--gray-900)' }}>
                {appData.selectedVersion === 'saas' ? 'SaaS 버전' : 
                 appData.selectedVersion === 'private' ? '프라이빗 버전' : '미선택'}
              </div>
            </div>
            <div style={{ 
              padding: '12px', 
              background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)', 
              borderRadius: 'var(--border-radius)',
              border: '1px solid var(--gray-200)'
            }}>
              <div style={{ fontSize: '12px', color: 'var(--gray-500)', marginBottom: '4px' }}>App ID</div>
              <div style={{ fontSize: '14px', fontWeight: '600', color: 'var(--gray-900)' }}>
                {appData.appId || '미입력'}
              </div>
            </div>
            <div style={{ 
              padding: '12px', 
              background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)', 
              borderRadius: 'var(--border-radius)',
              border: '1px solid var(--gray-200)'
            }}>
              <div style={{ fontSize: '12px', color: 'var(--gray-500)', marginBottom: '4px' }}>Data URL</div>
              <div style={{ 
                fontSize: '14px', 
                fontWeight: '600', 
                color: 'var(--gray-900)',
                wordBreak: 'break-all'
              }}>
                {appData.dataUrl || '미입력'}
              </div>
            </div>
          </div>

          <InfoBox type="success" title="설정 완료!">
            <p style={{ margin: 0 }}>
              모든 기본 설정이 완료되었습니다. 이제 데이터가 수집되기 시작하면 
              실시간으로 분석 결과를 확인할 수 있습니다.
            </p>
          </InfoBox>
        </Card>
      </div>

      {/* Dashboard Creation Steps */}
      <div style={{ marginBottom: '32px' }}>
        <Card>
          <h4 style={{ 
            fontSize: '18px', 
            fontWeight: '600', 
            marginBottom: '16px',
            color: 'var(--gray-900)'
          }}>
            첫 번째 대시보드 생성하기
          </h4>

          <div style={{ 
            display: 'flex', 
            flexDirection: 'column', 
            gap: '16px' 
          }}>
            {dashboardSteps.map((step, index) => (
              <div key={step.step} style={{ 
                display: 'flex', 
                alignItems: 'flex-start', 
                gap: '16px',
                padding: '16px',
                background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)',
                borderRadius: 'var(--border-radius)',
                border: '1px solid var(--gray-200)'
              }}>
                <div style={{
                  width: '40px',
                  height: '40px',
                  borderRadius: 'var(--border-radius)',
                  backgroundColor: 'var(--white)',
                  border: '1px solid var(--gray-200)',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  flexShrink: 0
                }}>
                  {step.icon}
                </div>
                <div style={{ flex: 1 }}>
                  <h5 style={{ 
                    fontSize: '16px', 
                    fontWeight: '600', 
                    margin: '0 0 8px 0',
                    color: 'var(--gray-900)'
                  }}>
                    {step.step}. {step.title}
                  </h5>
                  <p style={{ 
                    fontSize: '14px', 
                    color: 'var(--gray-600)', 
                    margin: 0,
                    lineHeight: '1.5'
                  }}>
                    {step.description}
                  </p>
                </div>
              </div>
            ))}
          </div>

        </Card>
      </div>

      {/* Recommended Metrics */}
      <div style={{ marginBottom: '32px' }}>
        <h4 style={{ 
          fontSize: '18px', 
          fontWeight: '600', 
          marginBottom: '16px',
          color: 'var(--gray-900)'
        }}>
          추천 분석 지표
        </h4>

        <div style={{ 
          display: 'grid', 
          gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
          gap: '24px' 
        }}>
          {recommendedMetrics.map((category, categoryIndex) => (
            <Card key={categoryIndex}>
              <div style={{ 
                display: 'flex', 
                alignItems: 'center', 
                gap: '12px',
                marginBottom: '16px'
              }}>
                {category.icon}
                <h5 style={{ 
                  fontSize: '16px', 
                  fontWeight: '600', 
                  margin: 0,
                  color: 'var(--gray-900)'
                }}>
                  {category.category}
                </h5>
              </div>

              <div style={{ 
                display: 'flex', 
                flexDirection: 'column', 
                gap: '12px' 
              }}>
                {category.metrics.map((metric, metricIndex) => (
                  <div key={metricIndex} style={{ 
                    padding: '12px',
                    background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)',
                    borderRadius: 'var(--border-radius)',
                    border: '1px solid var(--gray-200)'
                  }}>
                    <div style={{ 
                      fontSize: '14px', 
                      fontWeight: '600', 
                      color: 'var(--gray-900)',
                      marginBottom: '4px'
                    }}>
                      {metric.name}
                    </div>
                    <div style={{ 
                      fontSize: '12px', 
                      color: 'var(--gray-600)',
                      lineHeight: '1.4'
                    }}>
                      {metric.description}
                    </div>
                  </div>
                ))}
              </div>
            </Card>
          ))}
        </div>
      </div>

      {/* Next Steps */}
      <div style={{ marginBottom: '32px' }}>
        <InfoBox type="info" title="다음 단계 안내">
          <div style={{ 
            display: 'flex', 
            flexDirection: 'column', 
            gap: '8px',
            fontSize: '14px'
          }}>
            <p style={{ margin: '0 0 8px 0' }}>분석을 시작한 후 다음과 같은 기능들을 활용해보세요:</p>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
              <Badge variant="info" size="sm">고급</Badge>
              <span>커스텀 이벤트 추가 및 사용자 세그먼트 생성</span>
            </div>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
              <Badge variant="info" size="sm">고급</Badge>
              <span>A/B 테스트 및 퍼널 분석 설정</span>
            </div>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
              <Badge variant="info" size="sm">고급</Badge>
              <span>알림 및 자동 리포트 설정</span>
            </div>
          </div>
        </InfoBox>
      </div>

      {/* Completion */}
      <div style={{ 
        padding: '20px', 
        background: 'linear-gradient(135deg, #f8f9fa 0%, #e9ecef 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)', 
        borderRadius: 'var(--border-radius)',
        border: '1px solid var(--gray-200)'
      }}>
        <Checkbox
          checked={understood}
          onChange={setUnderstood}
          label="분석 시작 단계를 이해했으며, Thinking Engine 설정이 모두 완료되었습니다."
        />
      </div>

      {/* Celebration Modal */}
      {celebrationShown && (
        <div style={{
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          backgroundColor: 'rgba(0, 0, 0, 0.5)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          zIndex: 1000
        }}>
          <div style={{
            backgroundColor: 'white',
            padding: '40px',
            borderRadius: 'var(--border-radius-lg)',
            maxWidth: '500px',
            margin: '20px',
            textAlign: 'center',
            boxShadow: 'var(--shadow-xl)',
            position: 'relative'
          }}>
            <button
              onClick={() => setCelebrationShown(false)}
              style={{
                position: 'absolute',
                top: '16px',
                right: '16px',
                background: 'none',
                border: 'none',
                cursor: 'pointer',
                padding: '4px',
                borderRadius: '4px',
                color: 'var(--gray-400)',
                fontSize: '0'
              }}
            >
              <X size={20} />
            </button>
            <div style={{ 
              display: 'flex', 
              justifyContent: 'center', 
              marginBottom: '20px' 
            }}>
              <PartyPopper size={64} color="var(--success)" />
            </div>
            <h4 style={{ 
              fontSize: '28px', 
              fontWeight: '600', 
              margin: '0 0 16px 0',
              color: 'var(--gray-900)'
            }}>
              축하합니다! 🎉
            </h4>
            <p style={{ 
              fontSize: '16px', 
              margin: '0 0 32px 0',
              lineHeight: '1.6',
              color: 'var(--gray-600)'
            }}>
              Thinking Engine의 빠른 시작 가이드를 모두 완료했습니다.<br/>
              이제 강력한 데이터 분석의 세계를 탐험해보세요!
            </p>
            <div style={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: '12px',
              flexWrap: 'wrap'
            }}>
              <Button 
                variant="primary"
                onClick={() => window.open('https://te-web-naver.thinkingdata.kr/', '_blank')}
              >
